Marka: AtlasCopco;
Czas głównej pracy ciągłej: 24 godziny na dobę;
Moc nominalna: 5 kW;
Moc maksymalna: 5,5 kW;
Liczba faz: jednofazowa;
Pojemność zbiornika paliwa: 25 l;
Poziom ciśnienia akustycznego (LPA) w odległości 7 m: 72 dB(A)
Marka AtlasCopco to światowy lider w produkcji urządzeń przemysłowych i generatorów. Jeśli szukasz maszyn, które wytrzymają intensywną pracę i mają wsparcie serwisowe, AtlasCopco jest dobrze znanym wyborem. Przyjazne i profesjonalne podejście do Twoich potrzeb, dające pewność autonomii i jakości.
Generator benzynowy jednofazowy P6500 Atlas Copco Zaprojektowany do intensywnego, codziennego użytku. Generator jest uzwojony miedzią i zapewnia doskonałą wydajność w połączeniu z łatwością obsługi i transportu dzięki kółkom. Uchwyt i kółka mogą być montowane przez dowolnego użytkownika. Urządzenie pozwala mieć prąd tam, gdzie jest potrzebny i spełnia unijne normy hałasu. Generator posiada powiększony zbiornik paliwa o pojemności 25 litrów. Wyposażony w płytkę AVR, która zapewnia automatyczną regulację napięcia wyjściowego, dzięki czemu jest ono zawsze idealnie stałe w różnych warunkach obciążenia. Silnik uruchamia się za pomocą rozrusznika elektrycznego za pomocą kluczyka. W swoim arsenale posiada przełącznik różnicowy i przekaźnik kontroli podnapięciowej. Zamontowano zabezpieczenie przed pracą przy niskim poziomie oleju. Poziom ciśnienia akustycznego (LPA) w odległości 7 m wynosi zaledwie 72 dB(A) - dla porównania: chińskie generatory małej mocy (np. 3 kW) wytwarzają poziom hałasu co najmniej 92 dB, czyli o 25% głośniej niż szwedzkie! Co zapewnia wygodną obsługę zarówno generatora, jak i otaczających go ludzi. Istnieją dwa rodzaje gniazdek, wskaźnik paliwa, licznik godzin i woltomierz. - powiększony zbiornik paliwa - czujnik poziomu oleju - zabezpieczenie przed przegrzaniem - zgodny z normami UE w zakresie hałasu (obudowa wygłuszająca) - gniazda - system automatycznej regulacji napięcia (AVR) - wskaźniki: niskiego poziomu oleju silnikowego, przeciążenia silnika - złącza i kable do pracy równoległej
